export default (props) => {

    return (
        <div>
            <Link href="/about">
                <button> go to about </button>
            </Link>
            <Link href="/" style={{fontSize: 20}}> index </Link>
            <Link href="/about"> about </Link>
            <div>
                {props.children}
            </div>
        </div>
    )
}
